const organicAnimateSpirograph=(e,i,n,o,r,a,t,p,s,c,g)=>{const m=(e,i,n,o,r)=>(e-i)*(r-o)/(n-i)+o,d=g.noise1(e),h=g.noise1(e+1e4);g.noise1(e+100);if(Math.ceil(1e7*e)%3==0){const e=m(d,0,1,n,o),c=m(h,0,1,r,a),g=m(d,0,1,t,p),A=s;i.R=e,i.r=c,i.p=g,i.desity=A,i.render()}window.requestAnimationFrame(()=>{organicAnimateSpirograph(e+1e-6*(d+h),i,n,o,r,a,t,p,s,c,g)})};export default organicAnimateSpirograph;